setTimeout(function() {
  // Select the first checkbox element on the page
  const checkbox = document.querySelector('input[type=checkbox]');

  // Check if a checkbox was found
  if (checkbox) {
    // Get the ID of the checkbox element
    const checkboxId = checkbox.id;

    // Alert the ID of the checkbox
    alert(`The ID of the checkbox is: ${checkboxId}`);
  } else {
    // No checkbox found
    alert('No checkbox found on the page.');
  }
}, 3000);

