function selectDiaDiemAndContinue() {
    var diaDiemInput = document.getElementById('input-21');
    if (diaDiemInput) {
        diaDiemInput.click();
        setTimeout(function () {
            var options = document.querySelectorAll('.vue-recycle-scroller__item-view .v-list-item__title');
            for (var i = 0; i < options.length; i++) {
                if (options[i].innerText.trim() === 'Agribank Chi nhánh Hà Tây') {
                    options[i].click();
                    break;
                }
            }
            setTimeout(function () {
                var tiepTucButton = document.querySelector('button[step="3"].btn-main.next-step');
                if (tiepTucButton) {
                    tiepTucButton.click();
                }
                setTimeout(function () {
                    var input = document.getElementById('input-96');
                    input.value = 'Phan Cao Liễm';
                    triggerEvent(input, 'input');
                    input = document.getElementById('input-105');
                    input.value = 'Tổ 9 Minh Khai, Phủ Lý, Hà nam';
                    triggerEvent(input, 'input');
                    input = document.getElementById('input-108');
                    input.value = 'trinh.tienminh22@gmail.com';
                    triggerEvent(input, 'input');
                    input = document.getElementById('input-111');
                    input.value = '0915678586';
                    triggerEvent(input, 'input');
                    input = document.getElementById('input-114');
                    input.value = '001068012226';
                    triggerEvent(input, 'input');
                    input = document.getElementById('input-123');
                    input.value = 'Cục Cảnh Sát QLHC về TTXH';
                    triggerEvent(input, 'input');
                    input = document.getElementById('input-131');
                    input.value = '';
                    triggerEvent(input, 'input');
                    var input101 = document.getElementById('input-101');
                    if (input101) {
                        input101.focus();
                        input101.value = '06/08/1968';
                        triggerEvent(input101, 'input');
                        triggerEvent(input101, 'change');
                    }
                    var input119 = document.getElementById('input-119');
                    if (input119) {
                        input119.focus();
                        input119.value = '18/02/2021';
                        triggerEvent(input119, 'input');
                        triggerEvent(input119, 'change');
                    }
                    const checkbox = document.querySelector('input[type=checkbox]');
                    if (checkbox) {
                        checkbox.checked = true;
                        triggerEvent(checkbox, 'change');
                    }
                }, 100);
            }, 100);
        }, 100);
    }
}

// Gọi hàm từ console
selectDiaDiemAndContinue();

function checkAndReload() {
    fetch('/ma-xac-nhan/gold-online.html')
        .then(response => {
            if (response.status === 502 || response.status === 404) {
                // Nếu trang trả về 502 hoặc 404, reload lại trang
                location.reload();
            } else if (response.ok) {
                // Nếu tìm thấy file gold-online.html, đổi tên của tab và focus vào input
                document.title = "Captcha found!!";
                const input = document.querySelector('input[name="mxn"]');
                if (input) {
                    input.focus();
                }
            }
        })
        .catch(error => {
            console.error('Error:', error);
            // Nếu có lỗi trong quá trình fetch, reload lại trang
            location.reload();
        });
}

// Gọi hàm checkAndReload
checkAndReload();

